import React from 'react';
import store from './store/store';

function App() {

  store.dispatch({
    type: "inserted",
    payload: {
      number: 1,
      R: 23,
      G: 33,
      B: 55
    }
  });
  store.dispatch({
    type: "inserted",
    payload: {
      id: 1,
      R: 23,
      G: 33,
      B: 55
    }
  });
  store.dispatch({
    type: "modify",
    payload: {
      id: 1,
      R: 200,
      G: 200,
      B: 200
    }
  });
  return (
    <div >
      {"text: " + console.log(store.getState())}
      {"alt text"}
      <h1>dsadasd</h1>
      <h1>kkkk</h1>
      <h1>lll</h1>
    </div>
  );
}

export default App;
